    void AES_Write(void *aes_base, int offset, int value){
        *((int*)aes_base + offset) = value;
    }
    
    int AES_Read(void *aes_base, int offset){
        return *((int*)aes_base + offset);
    }

    void AES_Configure_Mode(void * aes_base, int mode){
        AES_Write(aes_base, AES_OFFSET_MODE, mode);
    }

    void AES_Configure_Key_Load(void *aes_base, int keyLoad){
        AES_Write(aes_base, AES_OFFSET_KEY_LOAD, keyLoad);
    }

    void AES_Configure_Key_0(void *aes_base, int key_0){
        AES_Write(aes_base, AES_OFFSET_KEY_0, key_0);
    }

    void AES_Configure_Key_1(void *aes_base, int key_1){
        AES_Write(aes_base, AES_OFFSET_KEY_1, key_1);
    }
    
    void AES_Configure_Key_2(void *aes_base, int key_2){
        AES_Write(aes_base, AES_OFFSET_KEY_2, key_2);
    }

    void AES_Configure_Key_3(void *aes_base, int key_3){
        AES_Write(aes_base, AES_OFFSET_KEY_3, key_3);
    }

    void AES_Configure_Read_Address(void *aes_base, int read_address){
        AES_Write(aes_base, AES_OFFSET_READ_ADDRESS, read_address);
    }

    void AES_Configure_Write_Address(void *aes_base, int write_address){
        AES_Write(aes_base, AES_OFFSET_WRITE_ADDRES, write_address);
    }

    void AES_Configure_Length(void *aes_base, int length){
        AES_Write(aes_base, AES_OFFSET_LENGTH, length);
    }

    void AES_Configure_Control(void *aes_base, int control){
        AES_Write(aes_base, AES_OFFSET_CONTROL, control);
    }

    void AES_Show_Result(void *mem, int offset, int length){
        int lengthWord = length / 4 ;
        int i = 0 ;
        for(i = 0; i < lengthWord; i++){
            printf("MEM = %.8x\n", *((int*) mem + offset/4 + i) );
        }
    }
	
